夕方は土砂降り雷雨に停電🌑

昔々、Guamで働いていた頃は台風の度に1週間ほど停電するので慣れっこでした。風速80mの風が吹いた時は、窓の外をどこかの家の屋根がまるで魔法の絨毯のようにフワフワ飛んでいる。〜こっちに来ないで〜さすがに身の危険を感じ、当時飼っていた犬をバッグに詰め、勤務先へ避難。途中、木の上に車が引っかかってるのを横目に😵ブレるハンドル握りしめ🚗😢

蛇🐍が、発電機に巻き付いた時は、復旧が長引き、３カ月も島全体、電気も水も無い生活でした。
浄化槽の循環が止まって藻だらけの、勤務先のプールの水がお風呂代わり。夜中にこっそりシャンプーと石鹸持って😆

若かったから、笑って乗り越えられた？今なら出来ないかな？

懐かしく貴重な体験、停電の夜に思い出しました😊

